  false,\n\t\"url\": null,\n\t\"notes\": \"Foreign longline vessels have transshipped
  fish through Guam to Asia since the late 1980s.  This database captures at a near
  census level all activities of transshipment, including species ID and landed weight
  of each individual fish, whether transshipped or rejected, plus the name and country
  of origin of the vessels and approximate area of fishing.  The data are collected
  and recorded by transshipment agents and provided to the Guam Bureau of Statistics
  and Plans (BSP, formerly the Guam Dept of Commerce) for entry into this database.
  These data are considered highly confidential.\",\n\t\"license_title\": null,\n\t\"extras\":
